CREATE TABLE barang_titipan(
   id_barang        VARCHAR(5) NOT NULL PRIMARY KEY
  ,nama_pengirim    VARCHAR(10) NOT NULL
  ,deskripsi_barang VARCHAR(30) NOT NULL
  ,tgl_penitipan    DATE  NOT NULL
);

create sequence barang_titipan_sq
   minvalue 1
  maxvalue 999999999
  start with 1
  increment by 1
  cache 20;

create or replace trigger barang_titipan_trig
before insert on barang_titipan
for each row
declare
  new_id varchar(5);
  cur_id number;
begin
  if inserting and :new.ID_BARANG is null then
    cur_id := barang_titipan_sq.nextval;
    if cur_id < 10 then
      select concat('B000', cur_id) into new_id from dual;
    else
      if cur_id < 100 then
        select concat('B00', cur_id) into new_id from dual;
      else
        if cur_id < 1000 then
          select concat('B0', cur_id) into new_id from dual;
        else
          select concat('B', cur_id) into new_id from dual;
        end if;
      end if;
    end if;
  :new.ID_BARANG := new_id;
  end if;
end;

